import '../SCSS/home.scss';
function HomeBody() {
  return (
    <div id="Home">
      <div className="Hero-image">
        <div className="heroText">
          <h1>Pool Party</h1>
          <h3>Welcome To Pool Party.</h3>

        </div>
      </div>
     <p>This is home</p>
  </div>
  );
}

export default HomeBody;
